function App() {

  const options = {
    method: 'GET',
    headers: {
      'X-RapidAPI-Key': 'be0e2e73c0mshaeb800133a26629p1afb25jsn3787abeaf6af',
      'X-RapidAPI-Host': 'community-open-weather-map.p.rapidapi.com'
    }
  };

  const getData=async()=>{

    try{
    const response=await fetch('https://community-open-weather-map.p.rapidapi.com/weather?q=London%2Cuk&lat=0&lon=0&callback=test&id=2172797&lang=null&units=imperial&mode=xml', options)
    const data= await response.json();
    console.log(data);
    }

    catch(error){
      console.log(error);
    }
  }
getData();
  return (
     <div className="Wheather-app">
       <div className="box">
       <input type="search" className='search'></input>
       <div className="fetching-info">
         <h2>London</h2>
         <h3>5.25 Cel</h3>
         <h4>Min :5.25 | Max:5.25 Cel</h4>
       </div>
       </div>
     </div>
  )
}

export default App
